import './App.css';
import Films from "./components/Movie/Films";
import NavBar from "./components/NavBar/NavBar";

import {BrowserRouter, Switch} from "react-router-dom";

function App() {
    return (

        <BrowserRouter>
            <Switch>
                <Route path='/movies'></Route>
            </Switch>
            <NavBar/>
            <Films/>
        </BrowserRouter>


    );
}

export default App;
